import React, { useState } from 'react';

export default function Quiz(props) {
    const {results} = props.questions

    console.log(results);

    return (
        <div>
            {results.map(question => {
                return (
                    <div className='quiz'>
                        <h2 className='quest'>{question.question}</h2>
                        <p>{question.correct_answer}</p>
                    </div>
                )
            })}        
        </div>
    )
}
